import React from 'react';

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      name: 'hi',
      fam: [{ gName: 'ace', age: 27 }, { gName: 'granny', age: 25 }]
    };
  }
  use = () => {
    console.log(this.state.fam.map(name => <h1>{name.gName}</h1>));
  };
  render() {
    return (
      <div>
        hi
        {this.state.fam.map(name => (
          <h1>{name.gName}</h1>
        ))}
      </div>
    );
  }
}

export default App;
